import React from 'react';
import styled from 'styled-components';

import Header from '../components/Header';

const Main = styled.main`
    width:100%;
    padding: 80px 20px;
    background-color:#eceae9;

    display:flex;
    justify-content:center;
    align-items:center;
`;

const Signup = () => {
    return (
        <>
            <Header headerType={2} />
            <Main>
                sign page
            </Main>
        </>
    );
}

export default Signup;
